import React from 'react';
import ExpenseForm from './ExpenseForm';

import './NewExpense.css';

const NewExpense = () => {

    const onSaveExpenseDateHandler = (enteredExpenseData) =>{
       const expenseDate ={
        ...enteredExpenseData,
        id : Math.random.toString()
       };
       HTMLFormControlsCollection.og(expenseDate);
    };

    //onSaveExpenseDate - event happen in child and return data to parent that is ExpenseForm
    return <div className="new-expense">
        <ExpenseForm onSaveExpenseData={onSaveExpenseDateHandler}></ExpenseForm>
    </div>
}

export default NewExpense;
